import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function EmployeeDashboard() {
    const [transactions, setTransactions] = useState([]);
    const [selectedTransactionId, setSelectedTransactionId] = useState(null); // Track the selected transaction
    const [submittedTransactionId, setSubmittedTransactionId] = useState(null); // Track submitted transaction
    const navigate = useNavigate();

    useEffect(() => {
        const authToken = localStorage.getItem('authToken');
        if (!authToken) {
            navigate('/employee-login');
            return;
        }

        const fetchTransactions = async () => {
            const response = await fetch('http://localhost:5000/api/transactions', {
                headers: {
                    'Authorization': `Bearer ${authToken}`,
                },
            });
            const data = await response.json();
            setTransactions(data);
        };

        fetchTransactions();
    }, [navigate]);

    const handleTransactionClick = (transactionId) => {
        setSelectedTransactionId(transactionId); // Set the selected transaction
    };

    const handleVerify = (transactionId) => {
        // Set the transaction to 'verifying' locally
        setTransactions(transactions.map((t) =>
            t.id === transactionId ? { ...t, status: 'verifying' } : t
        ));
        setSelectedTransactionId(transactionId); // Make sure the selected transaction stays highlighted
    };

    const handleSubmitVerification = (transactionId) => {
        // Directly set the submittedTransactionId and display the message
        setSubmittedTransactionId(transactionId);

        // Optionally, make an API call here to submit to SWIFT if needed
        setTimeout(() => {
            setSubmittedTransactionId(null); // Hide the message after a delay
        }, 3000); // Hide the message after 3 seconds
    };

    return (
        <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
            <div>
                <h1 style={{ textAlign: 'center' }}>Employee Dashboard</h1>
                <table style={{ margin: 'auto', borderCollapse: 'collapse', width: '80%' }}>
                    <thead>
                        <tr>
                            <th>Amount</th>
                            <th>Currency</th>
                            <th>Payee Account</th>
                            <th>SWIFT Code</th>
                            <th>Status</th>
                            <th>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {transactions.map((transaction) => (
                            <tr
                                key={transaction.id}
                                onClick={() => handleTransactionClick(transaction.id)} // Make the row clickable
                                style={{ cursor: 'pointer', backgroundColor: selectedTransactionId === transaction.id ? '#f0f0f0' : '' }}
                            >
                                <td>{transaction.amount}</td>
                                <td>{transaction.currency}</td>
                                <td>{transaction.payeeAccount}</td>
                                <td>{transaction.swiftCode}</td>
                                <td>{transaction.status}</td>
                                <td>
                                    {/* Only show the Verify button for the selected transaction */}
                                    {selectedTransactionId === transaction.id && (
                                        <button
                                            onClick={() => handleVerify(transaction.id)}
                                            style={{ backgroundColor: 'green', color: 'white', marginRight: '8px' }}
                                        >
                                            Verify
                                        </button>
                                    )}
                                    {/* Only show the Submit button for the selected transaction */}
                                    {selectedTransactionId === transaction.id && (
                                        <button
                                            onClick={() => handleSubmitVerification(transaction.id)}
                                            style={{ marginLeft: '8px' }}
                                        >
                                            Submit
                                        </button>
                                    )}
                                    {/* Pop-up message */}
                                    {submittedTransactionId === transaction.id && (
                                        <span
                                            style={{
                                                color: 'green',
                                                marginLeft: '10px',
                                                fontWeight: 'bold',
                                            }}
                                        >
                                            Submitted to SWIFT
                                        </span>
                                    )}
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
}

export default EmployeeDashboard;
